class Main extends Component{
    render(){
        return(
            <div className="container" style={{background:"red",position:"realtive"}}>

            
            <div className="row">
            <div className="col-sm-6">hello world</div>
            <div className="col-sm-6">hello world2</div>
            </div>
            </div>
            )
    }
}
export default Main
